import { StyleSheet, Text, View } from "react-native";
import React from "react";

const FindPeople = () => {
  return (
    <View>
      <View>
        <Image source={require("../assets/img2.jpeg")} />
      </View>
    </View>
  );
};

export default FindPeople;

const styles = StyleSheet.create({});
